import Header from "../components/header";
import Texto from "../components/Texto";
import { BrowserRouter } from "react-router-dom";
import { Inicio, AppGeral } from "../App"; // Importar ambos os componentes de uma única linha

function ProjetoUm() {
    return (
        <BrowserRouter>
            <AppGeral>
                <Header />
                <Inicio>
                    <Texto>Projeto Um</Texto>
                </Inicio>
            </AppGeral>
        </BrowserRouter>
    );
}

export default ProjetoUm;
